import React from "react";
import axios from "axios";
import { useParams } from "react-router-dom";

const Search = () => {
  const movies = "spiderman"/* useParams(); */
  React.useEffect(() => {
    axios
      .get("/api/movies/search/" + movies)
      .then((movie) => console.log(movie))
  });
  return <></>;
};

export default Search;
